import React, {useState,setState} from 'react';
// import './style.css'

function RegistrationForm() {
  const [make, setMake] = useState('');
  const [model, setModel] = useState('');
  const [year, setYear] = useState('');
  const [color, setColor] = useState('');
  const [licensePlate, setLicensePlate] = useState('');
  const [name, setName] = useState('');
  const [address, setAddress] = useState('');
  const [phone, setPhone] = useState('');
  const [email, setEmail] = useState('');
  const [proofOfOwnership, setProofOfOwnership] = useState(null);
  const [paymentMethod, setPaymentMethod] = useState('');
  const [creditCardNumber, setCreditCardNumber] = useState('');
  const [bankAccountNumber, setBankAccountNumber] = useState('');
  const [durationOfStay, setDurationOfStay] = useState('');
  const [entryTime, setEntryTime] = useState('');
  const [exitTime, setExitTime] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    // handle form submission and registration processing here
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Vehicle Information</h2>
      <label>
        Make:
        <input type="text" value={make} onChange={(e) => setMake(e.target.value)} />
      </label>
      <label>
        Model:
        <input type="text" value={model} onChange={(e) => setModel(e.target.value)} />
      </label>
      <label>
        Year:
        <input type="text" value={year} onChange={(e) => setYear(e.target.value)} />
      </label>
      <label>
        Color:
        <input type="text" value={color} onChange={(e) => setColor(e.target.value)} />
      </label>
      <label>
        License Plate Number:
        <input type="text" value={licensePlate} onChange={(e) => setLicensePlate(e.target.value)} />
      </label>

      <h2>Contact Information</h2>
      <label>
        Name:
        <input type="text" value={name} onChange={(e) => setName(e.target.value)} />
      </label>
      <label>
        Address:
        <input type="text" value={address} onChange={(e) => setAddress(e.target.value)} />
      </label>
      <label>
        Phone:
        <input type="text" value={phone} onChange={(e) => setPhone(e.target.value)} />
      </label>
      <label>
        Email:
        <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
      </label>

      <h2>Proof of Ownership</h2>
      <input type="file" onChange={(e) => setProofOfOwnership(e.target.files[0])} />

      <h2>Payment Information</h2>
      <label>
        Payment Method:
        <select value={paymentMethod} onChange={(e) => setPaymentMethod(e.target.value)}>
          <option value="gpay">GPay</option>
          <option value="phonepe">PhonePe</option>
          <option value="paytm">Paytm</option>
          <option value="creditCard">Credit Card</option>
          <option value="bankAccount">Bank Account</option>
        </select>
      </label>
      {paymentMethod === 'creditCard' && (
      <label>
        Credit Card Number:
        <input type="text" value={creditCardNumber} onChange={(e) => setCreditCardNumber(e.target.value)} />
      </label>
     )}
{paymentMethod === 'bankAccount' && (
<label>
Bank Account Number:
<input type="text" value={bankAccountNumber} onChange={(e) => setBankAccountNumber(e.target.value)} />
</label>
)}
<label>
Duration of Stay:
<input type="text" value={durationOfStay} onChange={(e) => setDurationOfStay(e.target.value)} />
</label>
<label>
Entry Time:
<input type="datetime-local" value={entryTime} onChange={(e) => setEntryTime(e.target.value)} />
</label>
<label>
Exit Time:
<input type="datetime-local" value={exitTime} onChange={(e) => setExitTime(e.target.value)} />
</label>
<button type="submit">Register</button>
</form>
);
}

export default ParkingRegistrationForm;
